function drawTree(node)
    if isempty(node)
        return;
    end

    % Draw the bounding box
    x_min = node.bounds(1,1);
    x_max = node.bounds(1,2);
    y_min = node.bounds(2,1);
    y_max = node.bounds(2,2);
    rectangle('Position', [x_min, y_min, x_max - x_min, y_max - y_min], ...
              'EdgeColor', 'k');

    % Draw the body if it exists
    if ~isempty(node.body)
        plot(node.body(1), node.body(2), 'ro', 'MarkerSize', 5, 'MarkerFaceColor', 'r');
    end

    % Recursively draw children
    for i = 1:4
        if ~isempty(node.children{i})
            drawTree(node.children{i});
        end
    end
end



% Create root bounding box
bounds = [0 1; 0 1];  % Define your simulation region (1x1 square)
root = BHTreeNode(bounds);

% Generate N random particles
N = 100;  % You can increase this for denser trees
positions = rand(N, 2);     % Random x and y in [0,1]
masses = ones(N, 1);        % Set all masses = 1 (can randomize if needed)
ids = (1:N)';               % Unique IDs

particles = [positions, masses, ids];

% Insert all particles
for i = 1:N
    root.insert(particles(i, :));
end

% Visualize tree
figure; %[output:6be5a9a2]
hold on; %[output:6be5a9a2]
axis equal; %[output:6be5a9a2]
xlim([bounds(1,1), bounds(1,2)]); %[output:6be5a9a2]
ylim([bounds(2,1), bounds(2,2)]); %[output:6be5a9a2]
drawTree(root); %[output:6be5a9a2]
title('Barnes-Hut Tree with Random Particles'); %[output:6be5a9a2]


